import React from 'react';
import NavBarmusica from '../components/NavBarmusica.jsx';
import Banner from '../components/Bannermusica.jsx';
import Canciones from '../components/Canciones.jsx'


class Bonhomiamusica extends React.Component{
    render (){
        return(
        <div>
            <div>
                <NavBarmusica/>
            </div>
            <div>
                <Banner/>
            </div>
            <div>
                <Canciones/>
            </div>

        </div>
        
        ) 
    }
}
export default Bonhomiamusica ;
